import React from "react";
import { BrowserRouter as Router , Link, Route} from "react-router-dom";

const Form=(props)=>{
  return <p>Form</p>
};


const App = () => {
  return (
    <>
        < Router>
        <div className="App">
           
          <h1>Teknolojik Yemekler</h1>
          <p><Link to="/">Ana Sayfa</Link></p>

         <Route path="/form" component={Form}/>
        
        </div>
      </ Router>
      
    </>
  );
};


export default App;
